<template>
		<AddTree
			:selectedCoords="selectedCoords"
		/>
		<div class="column is-3">
			<TreeDetail 
				:tree="tree"
				:isLoading="$store.state.isLoading"
			/>
		</div>
		<div class="column is-9">
			<yandex-map
				:coords="coords"
				:controls="controls"
				style="width: 100%; height: 94vh"
				:zoom="zoom"
				:cluster-options="clusterOptions"
				:icon="markerIcon"
				@click="onClick"
			>
				<ymap-marker
					v-for="tree in trees" 
					:coords="[tree.latitude, tree.longitude]"
					:marker-id=tree.id
					:hint-content=tree.name
					cluster-name="1"
					:icon="markerIcon"
					@click="showDetail(tree.id)"
				>
				</ymap-marker>
			</yandex-map>		
		</div>
</template>

<script>
import axios from 'axios';
import {loadYmap, yandexMap, ymapMarker } from 'vue-yandex-maps'
import AddTree from './AddTree.vue';
import TreeDetail from './TreeDetail.vue';

export default {
	name: "Maps",
	components: { yandexMap, ymapMarker, TreeDetail, AddTree },
	props: {
		regCoords: null
	},	
	data() {
		return {
		trees: [],
		coords: this.$store.state.regCoords,
		selectedCoords: null,
		zoom: 11,
		controls: ['zoomControl', 'geolocationControl'],
		markerIcon: {
			layout: 'default#imageWithContent',
			imageHref: "data:image/png;base64,",
			imageSize: [36, 36],
			imageOffset: [-20, -20],

		},
		clusterOptions: {
			1: {
					clusterDisableClickZoom: false,
					clusterOpenBalloonOnClick: false,
					clusterHideIconOnBalloonOpen: false,
					geoObjectHideIconOnBalloonOpen: false,

					clusterIcon: "data:image/png;base64,",
					clusterIcons: [
						{
								href: "data:image/png;base64,",
								size: [50, 50],
								offset: [-20, -20]
						},
						{
								href: "data:image/png;base64,",
								size: [70, 70],
								offset: [-30, -30]
						}
					],
			},
    },
		tree: null
  	} 
	},
	mounted() {
		this.getData()
	},
	methods: {
		async getData() {
			await axios
				.get("api/v1/trees/")
				.then(response => {
						console.log(response)
						this.trees = response.data
				})
				.catch(error => {
						error.value = error
						console.log(error)
				})
		},
		onClick(e) {
			this.selectedCoords = e.get('coords');
		},
		async showDetail(id) {
			this.$store.commit('setIsLoading', true)
			await axios
				.get("api/v1/tree/" + id)
				.then(response => {
						this.tree = response.data
				})
				.catch(error => {
						error.value = error
				})

			this.$store.commit('setIsLoading', false)
		},
	},
	watch: {
		regCoords: {
			handler(regCoords) {
				this.coords = regCoords
			}
		}
	}

}
</script>
